text139587.addInnerText('<div id=\"text139587\"><a id=\"text139587anc\" tabindex=\"14\"style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.192\" style=\"margin-left:0px;text-indent:0px;line-height:1.192;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text139587Font3\" style=\"background-color:transparent\" >\n&nbsp;</span ></p >\n<ol  start=\"1\" style=\"list-style-position:outside;text-align:justify;\" >\n<li  class=\"text139587Font5\" style=\"line-height:1.192;position:relative;padding-left:10px;list-style-type:decimal;margin-left:40px;margin-top:0px;margin-bottom:0px;\"><span class=\"text139587Font4\"  >Menjaga pola makan sehat</span ><span class=\"text139587Font5\" style=\"background-color:transparent\" >\n</span ></li >\n<li  class=\"text139587Font4\" style=\"line-height:1.192;position:relative;padding-left:10px;list-style-type:decimal;margin-left:40px;margin-top:0px;margin-bottom:0px;\"><span class=\"text139587Font4\"  >Menggunakan bahan makanan yang alami dan mudah diperoleh &#92;\n</span ></li >\n<li  class=\"text139587Font5\" style=\"line-height:1.192;position:relative;padding-left:10px;list-style-type:decimal;margin-left:40px;margin-top:0px;margin-bottom:0px;\"><span class=\"text139587Font4\"  >Lebih berhati-hati dalam memilih makanan yang baik dan sehat untuk dikonsumsi. </span ><span class=\"text139587Font5\" style=\"background-color:transparent\" >\n</span ></li >\n<li  class=\"text139587Font4\" style=\"line-height:1.192;position:relative;padding-left:10px;list-style-type:decimal;margin-left:40px;margin-top:0px;margin-bottom:0px;\"><span class=\"text139587Font4\"  >Mengkonsumsi makanan yang sehat serta memiliki nilai gizi yang tinggi \n</span ></li >\n<li  class=\"text139587Font4\" style=\"line-height:1.192;position:relative;padding-left:10px;list-style-type:decimal;margin-left:40px;margin-top:0px;margin-bottom:0px;\"><span class=\"text139587Font4\"  >Bagi para orang tua, &nbsp;memberikan bekal makanan kepada anak-anak saat di sekolah agar dapat &nbsp;mencukupi kebutuhan gizi anak serta menghindarkan anak dari kebiasaan jajan di sekolah sehingga terhindar dari gangguan penyakit akibat makanan yang mengandung zat aditif berbahaya\n</span ></li >\n<li  class=\"text139587Font4\" style=\"line-height:1.192;position:relative;padding-left:10px;list-style-type:decimal;margin-left:40px;margin-top:0px;margin-bottom:0px;\"><span class=\"text139587Font4\"  >Membaca label pada kemasan baik dari segi kadaluarsa maupun komposisinya.\n</span ></li >\n<li  class=\"text139587Font4\" style=\"line-height:1.192;position:relative;padding-left:10px;list-style-type:decimal;margin-left:40px;margin-top:0px;margin-bottom:0px;\"><span class=\"text139587Font4\"  >Melakukan penyuluhan bahaya penggunaan zat aditif berbahaya kepada masyarakat\n</span ></li >\n<li  class=\"text139587Font4\" style=\"line-height:1.192;position:relative;padding-left:10px;list-style-type:decimal;margin-left:40px;margin-top:0px;margin-bottom:0px;\"><span class=\"text139587Font4\"  >memberikan rangkaian edukasi disertai dengan demonstrasi yang akan memberikan wawasan mengenai zat aditif kepada anak remaja</span ><span class=\"text139587Font6\"  > \n</span ></li >\n</ol >\n</div>\n');
text139587.build()
